import React, {Component} from "react";

class Name extends Component {
    constructor(props){
      super(props);
    }


     render(){
      const { task } = this.props;

      return (
        <div>

          <label htmlFor="taskInput">Enter task</label>
          <input
            onChange={this.props.handleChange}
            Value={task.text}
            type="text"
            id="taskInput"
          ></input>

    </div>
      )
    }
  }

  export default Name;
